// SPDX-License-Identifier: MIT

import "@openzeppelin/contracts/access/Ownable.sol";
import "./ERC721Hashima.sol";

pragma solidity ^0.8.0;


// Interfaz para implementar sistema de firma en un NFT
contract SigningSystem is Ownable{

    ERC721Hashima BASE_CONTRACT;

    constructor(ERC721Hashima _contract){
        BASE_CONTRACT=_contract;
    }

    mapping(address=>mapping(uint256=>bool))private SIGNED;

    function sign(address smart_contract,uint256 tokenId)external onlyOwner{
        require(tokenId!=0,'Cannot be 0');
        require(!SIGNED[smart_contract][tokenId],'Already signed');
        SIGNED[smart_contract][tokenId]=true;
    }

    function isSigned(address smart_contract,uint256 hashimaID)external view returns(bool){
        return SIGNED[smart_contract][hashimaID];
    }
}
